import React from "react";
import notes from "../notes";

function Note() {
  console.log(notes);
  return (
    <div className="note">
      {notes.map((note) => {
        <h1>{note.title}</h1>;
      })}
      <p>this is the note content</p>
    </div>
  );
}

export default Note;
